// import { useState } from "react";

import avatar from "../../images/image-avatar.png";
import { Link } from "react-router-dom";

const RightNav = ({ handleClick }) => {
  // function handleClick(e) {
  //   e.target.parentNode.nextSibling.classList.toggle("hidden");

  //   // if (!e.target.parentNode.nextSibling) {
  //   //   console.log("nice");
  //   // }

  //   console.log(e.target.parentNode.nextSibling);
  //   console.log(e.window);
  // }

  return (
    <div className="rightNav flex items-center justify-end pr-6 w-3/12 relative">
      <div className="cart pr-10 pl-4 group">
        <Link onClick={handleClick}>
          <svg width="22" height="20" xmlns="http://www.w3.org/2000/svg">
            <path
              d="M20.925 3.641H3.863L3.61.816A.896.896 0 0 0 2.717 0H.897a.896.896 0 1 0 0 1.792h1l1.031 11.483c.073.828.52 1.726 1.291 2.336C2.83 17.385 4.099 20 6.359 20c1.875 0 3.197-1.87 2.554-3.642h4.905c-.642 1.77.677 3.642 2.555 3.642a2.72 2.72 0 0 0 2.717-2.717 2.72 2.72 0 0 0-2.717-2.717H6.365c-.681 0-1.274-.41-1.53-1.009l14.321-.842a.896.896 0 0 0 .817-.677l1.821-7.283a.897.897 0 0 0-.87-1.114ZM6.358 18.208a.926.926 0 0 1 0-1.85.926.926 0 0 1 0 1.85Zm10.015 0a.926.926 0 0 1 0-1.85.926.926 0 0 1 0 1.85Zm2.021-7.243-13.8.81-.57-6.341h15.753l-1.383 5.53Z"
              fill="black"
              fillRule="nonzero"
            />
          </svg>
        </Link>
        <div className="cart-modal  bg-white-2 absolute inset-x-0 top-14 drop-shadow-2xl rounded-lg h-52 hidden ">
          <div className="header py-2 px-2 h-12 border-b-2 border-primary-3">
            <p className="font-bold ">Cart</p>
          </div>
          <div className="body  h-4/5 flex items-center justify-center">
            <p className="text-blue-2 font-bold ">Hi, this is my cart</p>
          </div>
        </div>
      </div>

      <a href="#">
        <img src={avatar} width={50} alt="profile-avatar" className="outline rounded-full hover:outline-primary-1 outline-transparent outline-2" />
      </a>
    </div>
  );
};

export default RightNav;
